import React from 'react';
import Carrousel from './Carousel';
import '../Styles/Home.css';

function Home () {
  return (
  <figure class="stack">
    <div class="card one">
      <span>Top</span>
    </div>
    <div class="card two">
      <span>Middle</span>
    </div>
    <div>
      <span>Bottom</span>
    </div>
    </figure>
  )
}

export default Home;
